<script lang="ts" module>
    import { type VariantProps, tv } from "tailwind-variants"

    export const noiseVariants = tv({
        base: "opacity-[0.2]",
        variants: {
            intensity: {
                low: "bg-[size:_300px_300px] opacity-[0.25] dark:opacity-[0.2]",
                medium: "bg-[size:_400px_400px] opacity-[0.3] dark:opacity-[0.3]",
                high: "bg-[size:_500px_500px] opacity-[0.4] dark:opacity-[0.4]"
            },
        },
        defaultVariants: {
            intensity: "low",
        }
    })

    export type NoiseIntensity = VariantProps<typeof noiseVariants>["intensity"]

    export type NoiseProps = {
        intensity?: NoiseIntensity
        class?: string
    }
</script>

<script lang="ts">
    import { cn } from "../../utils.js"

    let {
        intensity = "low",
        class: className
    }: NoiseProps = $props()

</script>

<span class={cn(
    "noise absolute inset-0 w-screen h-screen pointer-events-none mix-blend-multiply dark:mix-blend-normal blur-[0.2px]",
    noiseVariants({ intensity }),
    className
)}></span>

<style>
    .noise {
        background-image: url(data:image/png;base64,);
    }
</style>
